<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Panel de Seguimiento PLC 2026 - Fundaci√≥n Social Alberto Merani</title>
    <script crossorigin src="https://cdn.jsdelivr.net/npm/react@18/umd/react.production.min.js"></script>
    <script crossorigin src="https://cdn.jsdelivr.net/npm/react-dom@18/umd/react-dom.production.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/@babel/standalone@7/babel.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/xlsx@0.18.5/dist/xlsx.full.min.js"></script>
    <script src="https://cdn.tailwindcss.com"></script>
    <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@300;400;500;600;700;800&display=swap" rel="stylesheet">
    <style>
        * { font-family: 'Montserrat', sans-serif; }
        .progress-bar-fill {
            background: linear-gradient(to right, #8b5cf6, #6366f1);
            transition: width 0.6s ease-out;
        }
        .progress-bar-fill.success {
            background: linear-gradient(to right, #10b981, #059669);
        }
        .tab-active {
            background: #1d4ed8;
            color: white;
            font-weight: 800;
            box-shadow: 0 -2px 0 #1d4ed8 inset;
        }
        .tab-inactive {
            color: #4b5563;
        }
        .tab-inactive:hover {
            color: #1d4ed8;
            background: #eff6ff;
        }
    </style>
</head>
<body class="bg-gradient-to-br from-purple-50 via-white to-blue-50 min-h-screen">
    <div id="root"></div>

    <script type="text/babel">
        const { useState, useEffect, useMemo } = React;

        // ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
        // CONFIGURACI√ìN
        // ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
        const SCRIPT_ADMIN      = "https://script.google.com/macros/s/AKfycbxXNv4R9lN9KeIDnQMBuHooCxdMhPHYfzDTwhiS4_rcWGg5IZAx4TDb6yZPz8y-rZeanQ/exec";
        const SCRIPT_SEGUIMIENTO = "https://script.google.com/macros/s/AKfycbxKK2f81UpeN4-n00R9w15gxreS9Kiv5qQbwj63eQDazJNSGEuWx4zIMlQ5dtMN343NAw/exec";
        const GRADOS = ["Tercero", "Quinto", "Noveno", "Once"];
        const META_COBERTURA = 90;

        // ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
        // COMPONENTE: PANEL ADMIN
        // ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
        function PanelAdmin() {
            const [estudiantes, setEstudiantes] = useState([]);
            const [loading, setLoading] = useState(true);
            const [filtroInstitucion, setFiltroInstitucion] = useState('');
            const [filtroInstitucionNombre, setFiltroInstitucionNombre] = useState('');
            const [filtroGrado, setFiltroGrado] = useState('');
            const [consultorSeleccionado, setConsultorSeleccionado] = useState(null);
            const [mensaje, setMensaje] = useState({ tipo: '', texto: '' });
            const [instituciones, setInstituciones] = useState([]);
            const [loadingInstituciones, setLoadingInstituciones] = useState(true);
            const [busquedaInst, setBusquedaInst] = useState('');
            const [mostrarSugerencias, setMostrarSugerencias] = useState(false);

            useEffect(() => {
                if (estudiantes.length === 0) cargarDatos();
                if (instituciones.length === 0) cargarInstituciones();
            }, []);

            const cargarInstituciones = async () => {
                try {
                    setLoadingInstituciones(true);
                    const response = await fetch(`${SCRIPT_ADMIN}?action=obtenerInstituciones`);
                    const data = await response.json();
                    if (data.success) setInstituciones(data.instituciones);
                    else setInstituciones([]);
                } catch (error) {
                    setInstituciones([]);
                } finally {
                    setLoadingInstituciones(false);
                }
            };

            const cargarDatos = async () => {
                try {
                    const response = await fetch(`${SCRIPT_ADMIN}?action=getData`);
                    const json = await response.json();
                    if (!json.success) throw new Error(json.error || 'Error desconocido');
                    setEstudiantes(json.data || []);
                    setLoading(false);
                    mostrarMensaje('success', `‚úÖ ${json.data.length} estudiantes cargados`);
                } catch (error) {
                    mostrarMensaje('error', 'Error al cargar datos: ' + error.message);
                    setLoading(false);
                }
            };

            const mostrarMensaje = (tipo, texto) => {
                setMensaje({ tipo, texto });
                setTimeout(() => setMensaje({ tipo: '', texto: '' }), 5000);
            };

            const obtenerConsultorPorCodigo = (codigoInstitucion) => {
                if (!codigoInstitucion) return 'Sin Asignar';
                const codigoNormalizado = codigoInstitucion.toString().trim();
                const inst = instituciones.find(i => (i.codigo || '').toString().trim() === codigoNormalizado);
                return inst && inst.consultor ? inst.consultor : 'Sin Asignar';
            };

            const colegiosPorConsultor = useMemo(() => {
                const map = {};
                instituciones.forEach(inst => {
                    const c = inst.consultor || 'Sin Asignar';
                    if (!map[c]) map[c] = [];
                    map[c].push(inst);
                });
                return map;
            }, [instituciones]);

            const estudiantesFiltrados = useMemo(() => {
                return estudiantes.filter(est => {
                    if (consultorSeleccionado && obtenerConsultorPorCodigo(est.codigoInstitucion) !== consultorSeleccionado) return false;
                    if (filtroInstitucion && est.codigoInstitucion?.toString().trim() !== filtroInstitucion.toString().trim()) return false;
                    if (filtroGrado && est.grado !== filtroGrado) return false;
                    return true;
                });
            }, [estudiantes, consultorSeleccionado, filtroInstitucion, filtroGrado, instituciones]);

            const institucionesInscritas = useMemo(() => [...new Set(estudiantes.map(e => e.institucion))], [estudiantes]);

            const calcularProgresoConsultor = (nombreConsultor) => {
                const colegios = colegiosPorConsultor[nombreConsultor] || [];
                const inscritos = colegios.filter(c => institucionesInscritas.some(inst => inst.includes(c.nombre))).length;
                const total = colegios.length;
                const porcentaje = total > 0 ? Math.round((inscritos / total) * 100) : 0;
                return { inscritos, total, porcentaje, faltantes: total - inscritos };
            };

            const obtenerColegiosConsultor = (nombreConsultor) => {
                return (colegiosPorConsultor[nombreConsultor] || []).map(c => ({
                    ...c,
                    inscrito: institucionesInscritas.some(inst => inst.includes(c.nombre))
                }));
            };

            const institucionesFiltradas = instituciones.filter(inst =>
                inst.nombre.toLowerCase().includes(busquedaInst.toLowerCase()) ||
                inst.codigo.toLowerCase().includes(busquedaInst.toLowerCase())
            );

            const seleccionarInstitucion = (inst) => {
                setFiltroInstitucion(inst.codigo);
                setFiltroInstitucionNombre(inst.nombre);
                setBusquedaInst('');
                setMostrarSugerencias(false);
            };

            const limpiarFiltro = () => {
                setFiltroInstitucion('');
                setFiltroInstitucionNombre('');
                setBusquedaInst('');
            };

            const exportarDatos = (formato) => {
                if (estudiantesFiltrados.length === 0) {
                    mostrarMensaje('warning', 'No hay datos para exportar');
                    return;
                }
                const datosExportar = estudiantesFiltrados.map(est => ({
                    'Timestamp': est.timestamp,
                    'Tipo': est.tipo,
                    'Instituci√≥n': est.institucion,
                    'C√≥digo': est.codigoInstitucion,
                    'Consultor': obtenerConsultorPorCodigo(est.codigoInstitucion),
                    'Inscriptor': est.inscriptorNombre,
                    'Rol': est.inscriptorRol,
                    'Email': est.inscriptorEmail,
                    'Acepta Datos': est.aceptaDatos,
                    'Estudiante': est.nombreEstudiante,
                    'Documento': est.documento,
                    'F.Nacimiento': est.fechaNacimiento,
                    'Grado': est.grado,
                    'Curso': est.curso,
                    'Inclusi√≥n': est.inclusion,
                    'Celular Estudiante': est.celular || '',
                    'Correo Estudiante': est.emailEstudiante || ''
                }));
                const wb = XLSX.utils.book_new();
                const ws = XLSX.utils.json_to_sheet(datosExportar);
                XLSX.utils.book_append_sheet(wb, ws, 'Estudiantes');
                const fecha = new Date().toISOString().split('T')[0];
                if (formato === 'excel') XLSX.writeFile(wb, `PLC_Admin_${fecha}.xlsx`);
                else XLSX.writeFile(wb, `PLC_Admin_${fecha}.csv`);
                mostrarMensaje('success', '‚úÖ Archivo descargado exitosamente');
            };

            const totalInstituciones = !loadingInstituciones && instituciones.length > 0 ? instituciones.length : 95;
            const institucionesFaltantes = totalInstituciones - institucionesInscritas.length;
            const estudiantesConAceptacion = estudiantes.filter(e => {
                    const v = String(e.inclusion || '').trim().toLowerCase();
                      return v === 's√≠' || v === 'si' || v === 's';
                        }).length;

            const gradientesConsultor = [
                'from-purple-400 to-pink-400',
                'from-blue-400 to-cyan-400',
                'from-emerald-400 to-teal-400',
                'from-orange-400 to-amber-400',
                'from-rose-400 to-red-400',
            ];
            const gradientesProgreso = [
                'from-purple-400 to-purple-600',
                'from-blue-400 to-blue-600',
                'from-emerald-400 to-emerald-600',
                'from-orange-400 to-orange-600',
                'from-rose-400 to-rose-600',
            ];

            if (loading || loadingInstituciones) {
                return (
                    <div className="flex items-center justify-center py-24">
                        <div className="text-center">
                            <div className="text-5xl mb-4">‚è≥</div>
                            <div className="text-xl text-purple-600 font-semibold">Cargando datos de inscripci√≥n...</div>
                        </div>
                    </div>
                );
            }

            const consultoresOrdenados = Object.keys(colegiosPorConsultor).sort((a, b) => {
                return calcularProgresoConsultor(b).porcentaje - calcularProgresoConsultor(a).porcentaje;
            });

            return (
                <div className="space-y-6">
                    {/* Mensaje */}
                    {mensaje.texto && (
                        <div className={`p-4 rounded-xl font-semibold ${
                            mensaje.tipo === 'success' ? 'bg-green-100 text-green-800 border-2 border-green-300' :
                            mensaje.tipo === 'warning' ? 'bg-yellow-100 text-yellow-800 border-2 border-yellow-300' :
                            'bg-red-100 text-red-800 border-2 border-red-300'
                        }`}>{mensaje.texto}</div>
                    )}

                    {/* Tarjetas de m√©tricas ‚Äî 8 tarjetas con distribuci√≥n por grado */}
                    <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-blue-600 mb-1">{institucionesInscritas.length}</div>
                            <div className="text-sm font-semibold text-gray-500">Instituciones Inscritas</div>
                            <div className="text-xs text-gray-400 mt-1">de {totalInstituciones} total</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-green-600 mb-1">{estudiantes.filter(e => e.grado === 'Tercero').length.toLocaleString()}</div>
                            <div className="text-sm font-semibold text-gray-500">Grado 3¬∞</div>
                            <div className="text-xs text-gray-400 mt-1">{estudiantes.length > 0 ? (estudiantes.filter(e=>e.grado==='Tercero').length/estudiantes.length*100).toFixed(1) : 0}% del total</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-yellow-500 mb-1">{estudiantes.filter(e => e.grado === 'Quinto').length.toLocaleString()}</div>
                            <div className="text-sm font-semibold text-gray-500">Grado 5¬∞</div>
                            <div className="text-xs text-gray-400 mt-1">{estudiantes.length > 0 ? (estudiantes.filter(e=>e.grado==='Quinto').length/estudiantes.length*100).toFixed(1) : 0}% del total</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-pink-600 mb-1">{estudiantesConAceptacion.toLocaleString()}</div>
                            <div className="text-sm font-semibold text-gray-500">Inclusi√≥n</div>
                            <div className="text-xs text-gray-400 mt-1">{estudiantes.length > 0 ? (estudiantesConAceptacion/estudiantes.length*100).toFixed(1) : 0}% del total</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-orange-500 mb-1">{estudiantes.filter(e => e.grado === 'Noveno').length.toLocaleString()}</div>
                            <div className="text-sm font-semibold text-gray-500">Grado 9¬∞</div>
                            <div className="text-xs text-gray-400 mt-1">{estudiantes.length > 0 ? (estudiantes.filter(e=>e.grado==='Noveno').length/estudiantes.length*100).toFixed(1) : 0}% del total</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-red-600 mb-1">{estudiantes.filter(e => e.grado === 'Once').length.toLocaleString()}</div>
                            <div className="text-sm font-semibold text-gray-500">Grado 11¬∞</div>
                            <div className="text-xs text-gray-400 mt-1">{estudiantes.length > 0 ? (estudiantes.filter(e=>e.grado==='Once').length/estudiantes.length*100).toFixed(1) : 0}% del total</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-purple-600 mb-1">{institucionesFaltantes}</div>
                            <div className="text-sm font-semibold text-gray-500">Faltan por Inscribir</div>
                            <div className="text-xs text-gray-400 mt-1">de {totalInstituciones} instituciones</div>
                        </div>
                        <div className="bg-white rounded-2xl shadow-lg p-6 text-center hover:shadow-xl transition-shadow">
                            <div className="text-4xl font-extrabold text-teal-600 mb-1">{Math.round((institucionesInscritas.length / totalInstituciones) * 100)}%</div>
                            <div className="text-sm font-semibold text-gray-500">Cobertura</div>
                            <div className="text-xs text-gray-400 mt-1">{institucionesInscritas.length} / {totalInstituciones} colegios</div>
                        </div>
                    </div>

                    {/* Exportar y Actualizar */}
                    <div className="bg-white rounded-xl shadow-lg p-6">
                        <h2 className="text-lg font-bold text-purple-800 mb-4">üìä Exportar Datos</h2>
                        <div className="grid md:grid-cols-3 gap-4">
                            <button onClick={() => exportarDatos('excel')}
                                className="bg-gradient-to-r from-green-400 to-emerald-500 text-white font-bold py-3 px-6 rounded-xl hover:from-green-500 hover:to-emerald-600 transition-all shadow-lg">
                                üì• Exportar Excel
                            </button>
                            <button onClick={() => exportarDatos('csv')}
                                className="bg-gradient-to-r from-blue-400 to-cyan-500 text-white font-bold py-3 px-6 rounded-xl hover:from-blue-500 hover:to-cyan-600 transition-all shadow-lg">
                                üìÑ Exportar CSV
                            </button>
                            <button onClick={cargarDatos}
                                className="bg-gradient-to-r from-purple-400 to-pink-500 text-white font-bold py-3 px-6 rounded-xl hover:from-purple-500 hover:to-pink-600 transition-all shadow-lg">
                                üîÑ Actualizar Datos
                            </button>
                        </div>
                    </div>

                    {/* Ranking de Consultores con Podio y Medallas */}
                    {Object.keys(colegiosPorConsultor).length > 0 && (
                        <div className="bg-white rounded-xl shadow-lg p-6">
                            <div className="flex items-center justify-between mb-6">
                                <h2 className="text-lg font-bold text-purple-800">üèÜ Ranking de Consultores</h2>
                                <button onClick={() => { cargarInstituciones(); cargarDatos(); }}
                                    className="text-sm bg-purple-100 hover:bg-purple-200 text-purple-700 px-3 py-1 rounded-lg transition font-semibold">
                                    üîÑ Actualizar
                                </button>
                            </div>

                            {/* PODIO TOP 3 */}
                            {(() => {
                                const top3 = consultoresOrdenados.slice(0, 3).map(nombre => ({
                                    nombre,
                                    ...calcularProgresoConsultor(nombre)
                                }));
                                if (top3.length >= 3) {
                                    return (
                                        <div className="mb-8 flex items-end justify-center gap-4">
                                            {/* 2do lugar */}
                                            <div className="flex-1 max-w-xs">
                                                <div className="bg-gradient-to-br from-gray-100 to-gray-200 rounded-xl p-4 text-center border-2 border-gray-400 shadow-lg">
                                                    <div className="text-4xl mb-2">ü•à</div>
                                                    <div className="font-bold text-gray-800 mb-1 text-sm">{top3[1].nombre}</div>
                                                    <div className="text-3xl font-bold text-gray-700">{top3[1].porcentaje}%</div>
                                                    <div className="text-xs text-gray-600 mt-1">{top3[1].inscritos}/{top3[1].total} colegios</div>
                                                </div>
                                                <div className="bg-gradient-to-b from-gray-300 to-gray-400 h-20 rounded-b-lg"></div>
                                            </div>
                                            {/* 1er lugar */}
                                            <div className="flex-1 max-w-xs" style={{transform: 'scale(1.08)'}}>
                                                <div className="bg-gradient-to-br from-yellow-100 to-yellow-200 rounded-xl p-4 text-center border-2 border-yellow-500 shadow-2xl">
                                                    <div className="text-5xl mb-2">ü•á</div>
                                                    <div className="font-bold text-yellow-900 mb-1 text-sm">{top3[0].nombre}</div>
                                                    <div className="text-4xl font-bold text-yellow-700">{top3[0].porcentaje}%</div>
                                                    <div className="text-xs text-yellow-800 mt-1">{top3[0].inscritos}/{top3[0].total} colegios</div>
                                                </div>
                                                <div className="bg-gradient-to-b from-yellow-400 to-yellow-600 h-32 rounded-b-lg"></div>
                                            </div>
                                            {/* 3er lugar */}
                                            <div className="flex-1 max-w-xs">
                                                <div className="bg-gradient-to-br from-orange-100 to-orange-200 rounded-xl p-4 text-center border-2 border-orange-400 shadow-lg">
                                                    <div className="text-4xl mb-2">ü•â</div>
                                                    <div className="font-bold text-orange-800 mb-1 text-sm">{top3[2].nombre}</div>
                                                    <div className="text-3xl font-bold text-orange-700">{top3[2].porcentaje}%</div>
                                                    <div className="text-xs text-orange-600 mt-1">{top3[2].inscritos}/{top3[2].total} colegios</div>
                                                </div>
                                                <div className="bg-gradient-to-b from-orange-300 to-orange-400 h-14 rounded-b-lg"></div>
                                            </div>
                                        </div>
                                    );
                                }
                                return null;
                            })()}

                            {/* TABLA COMPLETA CON MEDALLAS */}
                            <div className="border-t-2 border-gray-100 pt-6">
                                <h3 className="text-base font-semibold text-gray-700 mb-4">üìä Tabla Completa</h3>
                                <div className="space-y-3">
                                    {consultoresOrdenados.map((nombreConsultor, index) => {
                                        const { inscritos, total, porcentaje, faltantes } = calcularProgresoConsultor(nombreConsultor);
                                        const isSelected = consultorSeleccionado === nombreConsultor;

                                        let medalla = '';
                                        let colorBorde = 'border-gray-200';
                                        let colorFondo = 'bg-gray-50';
                                        let gradienteProgreso = 'from-green-400 to-emerald-500';

                                        if (index === 0) {
                                            medalla = 'ü•á'; colorBorde = 'border-yellow-400'; colorFondo = 'bg-yellow-50'; gradienteProgreso = 'from-yellow-400 to-yellow-600';
                                        } else if (index === 1) {
                                            medalla = 'ü•à'; colorBorde = 'border-gray-400'; colorFondo = 'bg-gray-50'; gradienteProgreso = 'from-gray-400 to-gray-600';
                                        } else if (index === 2) {
                                            medalla = 'ü•â'; colorBorde = 'border-orange-400'; colorFondo = 'bg-orange-50'; gradienteProgreso = 'from-orange-400 to-orange-600';
                                        }

                                        // Calcular inscritos por grado para este consultor
                                        const colegiosConsultor = colegiosPorConsultor[nombreConsultor] || [];
                                        const estudiantesConsultor = estudiantesFiltrados.filter(e =>
                                            obtenerConsultorPorCodigo(e.codigoInstitucion) === nombreConsultor
                                        );
                                        const porGradoConsultor = GRADOS.reduce((acc, g) => {
                                            acc[g] = estudiantesConsultor.filter(e => e.grado === g).length;
                                            return acc;
                                        }, {});

        // ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
        // COMPONENTE: PANEL SEGUIMIENTO
        // ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
        const MOMENTOS = ['Entrada', 'Control', 'Salida'];
        const MOMENTO_CONFIG = {
            'Entrada': { emoji: 'üìò', bg: 'bg-blue-100',  text: 'text-blue-800',  border: 'border-blue-400',  barra: 'from-blue-400 to-blue-600'   },
            'Control': { emoji: 'üìô', bg: 'bg-amber-100', text: 'text-amber-800', border: 'border-amber-400', barra: 'from-amber-400 to-amber-600'  },
            'Salida':  { emoji: 'üìó', bg: 'bg-green-100', text: 'text-green-800', border: 'border-green-400', barra: 'from-green-400 to-green-600'  },
        };

        function PanelSeguimiento() {
            const [estudiantes,    setEstudiantes]    = useState([]);
            const [presentaciones, setPresentaciones] = useState({});
            const [loading,        setLoading]        = useState(true);
            const [mensaje,        setMensaje]        = useState({ tipo: '', texto: '' });

            // Filtros de vista
            const [filtroConsultor,  setFiltroConsultor]  = useState('');
            const [filtroInstitucion,setFiltroInstitucion]= useState('');
            const [filtroGrado,      setFiltroGrado]      = useState('');
            const [filtroMomento,    setFiltroMomento]    = useState(''); // Entrada | Control | Salida | ''
            const [filtroEstado,     setFiltroEstado]     = useState(''); // meta_alcanzada | pendiente | ''
            const [busquedaInst,     setBusquedaInst]     = useState('');
            const [mostrarSugerencias,setMostrarSugerencias]=useState(false);

            // Vista de detalle de estudiantes
            const [vistaEstudiantes, setVistaEstudiantes] = useState(null); // null | 'presentaron' | 'faltantes'
            const [instSeleccionada, setInstSeleccionada] = useState(null); // para filtrar la lista

            useEffect(() => { if (estudiantes.length === 0) cargarDatos(); }, []);

            const cargarDatos = async () => {
                try {
                    setLoading(true);
                    const response = await fetch(`${SCRIPT_SEGUIMIENTO}?action=getSeguimientoPresentaciones`);
                    const json = await response.json();
                    if (!json.success) throw new Error(json.error || 'Error desconocido');
                    setEstudiantes(json.estudiantes || []);
                    setPresentaciones(json.presentaciones || {});
                    setLoading(false);
                    mostrarMensaje('success', `‚úÖ ${json.totalInscritos} inscritos cargados`);
                } catch (error) {
                    mostrarMensaje('error', 'Error al cargar: ' + error.message);
                    setLoading(false);
                }
            };

            const mostrarMensaje = (tipo, texto) => {
                setMensaje({ tipo, texto });
                setTimeout(() => setMensaje({ tipo: '', texto: '' }), 5000);
            };

            // ‚îÄ‚îÄ‚îÄ Enriquecer cada estudiante con sus momentos (cruce cliente) ‚îÄ‚îÄ‚îÄ
            const estudiantesEnriquecidos = useMemo(() => {
                return estudiantes.map(est => {
                    const historial = presentaciones[est.documento] || [];
                    const momentosSet = new Set(historial.map(h => {
                        const m = String(h.momento || '').trim().toLowerCase();
                        if (m === 'entrada') return 'Entrada';
                        if (m === 'control') return 'Control';
                        if (m === 'salida')  return 'Salida';
                        return null;
                    }).filter(Boolean));
                    return {
                        ...est,
                        presento_entrada: momentosSet.has('Entrada'),
                        presento_control: momentosSet.has('Control'),
                        presento_salida:  momentosSet.has('Salida'),
                        totalMomentos:    momentosSet.size,
                    };
                });
            }, [estudiantes, presentaciones]);

            const consultores = useMemo(() =>
                Array.from(new Set(estudiantesEnriquecidos.map(e => e.consultor))).filter(Boolean).sort(),
            [estudiantesEnriquecidos]);

            const instituciones = useMemo(() => {
                const map = new Map();
                estudiantesEnriquecidos.forEach(e => {
                    if (!map.has(e.codigoInstitucion))
                        map.set(e.codigoInstitucion, { codigo: e.codigoInstitucion, nombre: e.institucion, consultor: e.consultor });
                });
                return Array.from(map.values()).sort((a, b) => a.nombre.localeCompare(b.nombre));
            }, [estudiantesEnriquecidos]);

            const institucionesBusqueda = useMemo(() =>
                instituciones.filter(i =>
                    i.nombre.toLowerCase().includes(busquedaInst.toLowerCase()) ||
                    i.codigo.toLowerCase().includes(busquedaInst.toLowerCase())
                ), [instituciones, busquedaInst]);

            // ‚îÄ‚îÄ‚îÄ Filtros de contexto (NO excluyen estudiantes del universo) ‚îÄ‚îÄ‚îÄ
            // El universo base siempre son todos los inscritos filtrados por consultor/institucion/grado
            const estudiantesBase = useMemo(() => {
                return estudiantesEnriquecidos.filter(est => {
                    if (filtroConsultor   && est.consultor        !== filtroConsultor)   return false;
                    if (filtroInstitucion && est.codigoInstitucion !== filtroInstitucion) return false;
                    if (filtroGrado       && est.grado             !== filtroGrado)       return false;
                    return true;
                });
            }, [estudiantesEnriquecidos, filtroConsultor, filtroInstitucion, filtroGrado]);

            // Helper: ¬øpresent√≥ en el momento dado?
            const presentoEn = (est, momento) => {
                if (!momento) return est.presento_entrada || est.presento_control || est.presento_salida;
                if (momento === 'Entrada') return est.presento_entrada;
                if (momento === 'Control') return est.presento_control;
                if (momento === 'Salida')  return est.presento_salida;
                return false;
            };

            // ‚îÄ‚îÄ‚îÄ M√©tricas por instituci√≥n ‚îÄ‚îÄ‚îÄ
            const metricasPorInstitucion = useMemo(() => {
                const map = new Map();
                estudiantesBase.forEach(est => {
                    const key = est.codigoInstitucion;
                    if (!map.has(key)) {
                        map.set(key, {
                            codigo: est.codigoInstitucion,
                            nombre: est.institucion,
                            consultor: est.consultor,
                            porGrado: {},
                            // Contadores independientes por momento
                            porMomento: {
                                Entrada: { inscritos: 0, evaluados: 0 },
                                Control: { inscritos: 0, evaluados: 0 },
                                Salida:  { inscritos: 0, evaluados: 0 },
                            }
                        });
                    }
                    const inst = map.get(key);

                    // Acumular por grado con el momento seleccionado
                    if (!inst.porGrado[est.grado]) inst.porGrado[est.grado] = { inscritos: 0, evaluados: 0 };
                    inst.porGrado[est.grado].inscritos++;
                    if (presentoEn(est, filtroMomento)) inst.porGrado[est.grado].evaluados++;

                    // Acumular por momento (siempre los tres, independiente del filtro)
                    MOMENTOS.forEach(m => {
                        inst.porMomento[m].inscritos++;
                        if (presentoEn(est, m)) inst.porMomento[m].evaluados++;
                    });
                });

                return Array.from(map.values()).map(inst => {
                    let totalInscritos = 0, totalEvaluados = 0;
                    Object.values(inst.porGrado).forEach(g => {
                        totalInscritos += g.inscritos;
                        totalEvaluados += g.evaluados;
                    });
                    const porcentaje = totalInscritos > 0 ? (totalEvaluados / totalInscritos * 100) : 0;
                    return { ...inst, totalInscritos, totalEvaluados, porcentaje, metaAlcanzada: porcentaje >= META_COBERTURA };
                });
            }, [estudiantesBase, filtroMomento]);

            const institucionesFiltradas = useMemo(() => {
                let list = metricasPorInstitucion;
                if (filtroEstado === 'meta_alcanzada') list = list.filter(i => i.metaAlcanzada);
                else if (filtroEstado === 'pendiente') list = list.filter(i => !i.metaAlcanzada);
                return list.sort((a, b) => b.porcentaje - a.porcentaje);
            }, [metricasPorInstitucion, filtroEstado]);

            // Ranking con filtros activos (para mostrar tarjetas)
            const metricasPorConsultor = useMemo(() => {
                const map = new Map();
                metricasPorInstitucion.forEach(inst => {
                    if (!map.has(inst.consultor))
                        map.set(inst.consultor, { consultor: inst.consultor, totalInscritos: 0, totalEvaluados: 0, colegiosConMeta: 0, totalColegios: 0 });
                    const c = map.get(inst.consultor);
                    c.totalInscritos += inst.totalInscritos;
                    c.totalEvaluados += inst.totalEvaluados;
                    c.totalColegios++;
                    if (inst.metaAlcanzada) c.colegiosConMeta++;
                });
                return Array.from(map.values()).map(c => ({
                    ...c,
                    porcentajePromedio: c.totalInscritos > 0 ? (c.totalEvaluados / c.totalInscritos * 100) : 0
                })).sort((a, b) => b.porcentajePromedio - a.porcentajePromedio);
            }, [metricasPorInstitucion]);

            // Ranking GLOBAL sin filtro de consultor ‚Äî para mostrar puesto real
            // rankingGlobal: calcula puestos sobre TODOS los estudiantes sin filtros de contexto
            // (solo cambia seg√∫n el momento activo). As√≠ el puesto de cada consultor es siempre real.
            const rankingGlobal = useMemo(() => {
                const consGlobal = new Map();
                estudiantesEnriquecidos.forEach(est => {
                    if (!consGlobal.has(est.consultor)) consGlobal.set(est.consultor, { inscritos: 0, evaluados: 0 });
                    const c = consGlobal.get(est.consultor);
                    c.inscritos++;
                    if (presentoEn(est, filtroMomento)) c.evaluados++;
                });
                return Array.from(consGlobal.entries())
                    .map(([consultor, d]) => ({ consultor, pct: d.inscritos > 0 ? d.evaluados/d.inscritos*100 : 0 }))
                    .sort((a, b) => b.pct - a.pct);
            }, [estudiantesEnriquecidos, filtroMomento]);

            const getPuestoGlobal = (nombreConsultor) => {
                const idx = rankingGlobal.findIndex(r => r.consultor === nombreConsultor);
                return idx >= 0 ? idx + 1 : null;

            // ‚îÄ‚îÄ‚îÄ M√©tricas globales con los tres momentos ‚îÄ‚îÄ‚îÄ
            const metricas = useMemo(() => {

                    filtroMomento === 'Control' ? control : salida

                const colegiosConMeta = institucionesFiltradas.filter(i => i.metaAlcanzada).length;
                return {
                    totalInscritos: total, entrada, control, salida,
                    totalEvaluados: evalActual,
                    porcentajeCobertura: total > 0 ? (evalActual / total * 100) : 0,
                    colegiosConMeta, totalColegios: institucionesFiltradas.length

                if (vistaEstudiantes === 'faltantes')
                    return base.filter(e => !presentoEn(e, filtroMomento));

            }, [estudiantesBase, vistaEstudiantes, instSeleccionada, filtroMomento]);

            const seleccionarInstitucion = (inst) => { setFiltroInstitucion(inst.codigo); setBusquedaInst(''); setMostrarSugerencias(false); };
            const limpiarFiltros = () => { setFiltroConsultor(''); setFiltroInstitucion(''); setFiltroGrado(''); setFiltroEstado(''); setFiltroMomento(''); setBusquedaInst(''); setVistaEstudiantes(null); setInstSeleccionada(null); };

            };

            // ‚îÄ‚îÄ‚îÄ Exportar ‚îÄ‚îÄ‚îÄ
            const exportarResumen = () => {
                try {
                    const datos = institucionesFiltradas.map(inst => {
                        const fila = { 'Instituci√≥n': inst.nombre, 'C√≥digo': inst.codigo, 'Consultor': inst.consultor, 'Inscritos': inst.totalInscritos };
                        MOMENTOS.forEach(m => {
                            const d = inst.porMomento[m];
                            fila[`${m} - Evaluados`] = d.evaluados;
                            fila[`${m} - %`] = d.inscritos > 0 ? (d.evaluados/d.inscritos*100).toFixed(1)+'%' : '0%';
                        });
                        GRADOS.forEach(g => {
                            const d = inst.porGrado[g] || { inscritos: 0, evaluados: 0 };
                            fila[`${g} Inscritos`] = d.inscritos;
                            fila[`${g} Evaluados`] = d.evaluados;

                        fila['% Cobertura'] = inst.porcentaje.toFixed(1)+'%';
                        fila['Meta 90%'] = inst.metaAlcanzada ? 'S√ç ‚úì' : 'NO';
                        return fila;
                    });
                    const wb = XLSX.utils.book_new();
                    XLSX.utils.book_append_sheet(wb, XLSX.utils.json_to_sheet(datos), 'Resumen');
                    XLSX.writeFile(wb, `Seguimiento_PLC_${new Date().toISOString().split('T')[0]}.xlsx`);
                    mostrarMensaje('success', '‚úÖ Resumen exportado');

            const exportarLista = (tipo) => {

                    const datos = lista.map(e => ({

                        'Documento': e.documento, 'Grado': e.grado, 'Curso': e.curso || '',

                        'üìò Entrada': e.presento_entrada ? '‚úÖ' : '‚ùå',
                        'üìô Control': e.presento_control ? '‚úÖ' : '‚ùå',

                    const suffix = filtroMomento ? `_${filtroMomento}` : '_TodasPruebas';

                    const wb = XLSX.utils.book_new();

                    XLSX.writeFile(wb, `PLC_${nombre}_${new Date().toISOString().split('T')[0]}.xlsx`);
                    mostrarMensaje('success', `‚úÖ ${lista.length} estudiantes exportados`);

            const institucionSeleccionada = instituciones.find(i => i.codigo === filtroInstitucion);

            if (loading) return (
                <div className="flex items-center justify-center py-24">
                    <div className="text-center">

                    </div>

            const momentoActual = filtroMomento || 'Entrada';

            return (

                    {/* ‚îÄ‚îÄ Tarjetas: Total inscritos + una por momento, con desglose por grado ‚îÄ‚îÄ */}

                            <div className="text-4xl font-extrabold text-gray-800 mb-3">{metricas.totalInscritos.toLocaleString()}</div>
                            <div className="grid grid-cols-2 gap-1">
                                {[{g:'Tercero',l:'3¬∞',c:'text-green-600'},{g:'Quinto',l:'5¬∞',c:'text-yellow-500'},{g:'Noveno',l:'9¬∞',c:'text-orange-500'},{g:'Once',l:'11¬∞',c:'text-red-600'}].map(({g,l,c}) => (
                                    <div key={g} className="bg-gray-50 rounded-lg px-2 py-1 text-center">
                                        <div className={`text-sm font-extrabold ${c}`}>{estudiantesBase.filter(e=>e.grado===g).length.toLocaleString()}</div>
                                        <div className="text-xs text-gray-400">Grado {l}</div>

                            <div className="text-xs text-gray-400 mt-2 text-center">{metricas.totalColegios} colegios</div>
                        </div>

                        {/* Tarjetas por momento */}
                        {MOMENTOS.map(m => {
                            const cfg = MOMENTO_CONFIG[m];
                            const count = m === 'Entrada' ? metricas.entrada : m === 'Control' ? metricas.control : metricas.salida;
                            const pct = metricas.totalInscritos > 0 ? (count / metricas.totalInscritos * 100).toFixed(1) : '0.0';
                            const isActive = filtroMomento === m;
                            // Conteo por grado en este momento
                            const porGrado = {
                                Tercero: estudiantesBase.filter(e => e.grado==='Tercero' && (m==='Entrada'?e.presento_entrada:m==='Control'?e.presento_control:e.presento_salida)).length,
                                Quinto:  estudiantesBase.filter(e => e.grado==='Quinto'  && (m==='Entrada'?e.presento_entrada:m==='Control'?e.presento_control:e.presento_salida)).length,
                                Noveno:  estudiantesBase.filter(e => e.grado==='Noveno'  && (m==='Entrada'?e.presento_entrada:m==='Control'?e.presento_control:e.presento_salida)).length,
                                Once:    estudiantesBase.filter(e => e.grado==='Once'    && (m==='Entrada'?e.presento_entrada:m==='Control'?e.presento_control:e.presento_salida)).length,
                            };
                            return (
                                <div key={m}
                                    onClick={() => setFiltroMomento(isActive ? '' : m)}
                                    className={`rounded-2xl shadow-lg p-5 border-l-4 cursor-pointer transition-all hover:shadow-xl ${cfg.border} ${isActive ? cfg.bg : 'bg-white'}`}>
                                    <div className={`text-sm font-semibold mb-1 ${isActive ? cfg.text : 'text-gray-500'}`}>
                                        {cfg.emoji} {m} {isActive && <span className="text-xs font-normal">(activo)</span>}
                                    </div>
                                    <div className={`text-4xl font-extrabold mb-1 ${isActive ? cfg.text : 'text-gray-800'}`}>{count.toLocaleString()}</div>
                                    <div className={`text-xs mb-3 ${isActive ? cfg.text : 'text-gray-400'}`}>{pct}% cobertura</div>
                                    {/* Desglose por grado */}
                                    <div className="grid grid-cols-2 gap-1 mb-3">
                                        {[{g:'Tercero',l:'3¬∞',c:'text-green-600'},{g:'Quinto',l:'5¬∞',c:'text-yellow-500'},{g:'Noveno',l:'9¬∞',c:'text-orange-500'},{g:'Once',l:'11¬∞',c:'text-red-600'}].map(({g,l,c}) => (

                                            ‚úÖ Presentaron

                                        <button onClick={e => { e.stopPropagation(); setFiltroMomento(m); abrirDetalle('faltantes', null); }}
                                            className="flex-1 text-xs bg-red-100 hover:bg-red-200 text-red-700 rounded-lg py-1.5 font-semibold transition">
                                            ‚ùå Faltantes
                                        </button>
                                    </div>
                                </div>
                            );
                        })}
                    </div>

                    {/* ‚îÄ‚îÄ Barra de progreso global ‚îÄ‚îÄ */}
                    <div className="bg-white rounded-xl shadow-lg p-5">
                        <div className="flex items-center justify-between mb-3">
                            <h3 className="font-bold text-gray-700">
                                üìà Cobertura ‚Äî <span className={cfgActual.text}>{cfgActual.emoji} {momentoActual}</span>
                            </h3>
                            <div className="text-right">
                                <span className={`text-2xl font-bold ${cfgActual.text}`}>{metricas.porcentajeCobertura.toFixed(1)}%</span>
                                <div className="text-xs text-gray-500">{metricas.totalEvaluados} / {metricas.totalInscritos} estudiantes</div>
                            </div>
                        </div>
                        <div className="w-full bg-gray-200 rounded-full h-6 overflow-hidden">
                            <div className={`h-full flex items-center justify-center text-xs font-bold text-white transition-all ${metricas.porcentajeCobertura >= META_COBERTURA ? 'progress-bar-fill success' : 'progress-bar-fill'}`}
                                style={{ width: `${Math.min(metricas.porcentajeCobertura, 100)}%` }}>
                                {metricas.porcentajeCobertura >= 8 && `${metricas.porcentajeCobertura.toFixed(1)}%`}
                            </div>
                        </div>
                        <div className="flex justify-between text-xs text-gray-500 mt-2">
                            <span>Meta: {META_COBERTURA}%</span>
                            <span>üéØ {metricas.colegiosConMeta} / {metricas.totalColegios} colegios con meta</span>
                        </div>
                    </div>

                    {/* ‚îÄ‚îÄ Filtros ‚îÄ‚îÄ */}
                    <div className="bg-white rounded-xl shadow-lg p-6">
                        <h2 className="text-lg font-bold text-purple-800 mb-4">üîç Filtros y Exportaciones</h2>
                        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                            <div>
                                <label className="block text-sm font-semibold text-gray-700 mb-2">Consultor</label>
                                <select value={filtroConsultor} onChange={e => setFiltroConsultor(e.target.value)}
                                    className="w-full px-4 py-3 border-2 border-purple-200 rounded-xl outline-none">
                                    <option value="">Todos los consultores</option>
                                    {consultores.map(c => <option key={c} value={c}>{c}</option>)}
                                </select>
                            </div>
                            <div>
                                <label className="block text-sm font-semibold text-gray-700 mb-2">Instituci√≥n</label>
                                {!filtroInstitucion ? (
                                    <div className="relative">
                                        <input type="text" value={busquedaInst}
                                            onChange={e => { setBusquedaInst(e.target.value); setMostrarSugerencias(true); }}
                                            onFocus={() => setMostrarSugerencias(true)}
                                            placeholder="Buscar por nombre o c√≥digo..."
                                            className="w-full px-4 py-3 border-2 border-purple-200 rounded-xl outline-none" />
                                        {mostrarSugerencias && busquedaInst && institucionesBusqueda.length > 0 && (
                                            <div className="absolute z-10 w-full mt-1 bg-white border-2 border-purple-200 rounded-xl shadow-xl max-h-64 overflow-y-auto">
                                                {institucionesBusqueda.slice(0, 10).map(inst => (

                                                        className="w-full text-left px-4 py-3 hover:bg-purple-50 border-b border-gray-100 last:border-b-0">
                                                        <div className="font-semibold text-gray-800">{inst.nombre}</div>
                                                        <div className="text-xs text-gray-500">C√≥d: {inst.codigo} | {inst.consultor}</div>
                                                    </button>

                                    </div>
                                ) : (
                                    <div className="flex gap-2">
                                        <div className="flex-1 px-4 py-3 bg-purple-50 border-2 border-purple-300 rounded-xl text-gray-800 font-medium text-sm truncate">
                                            {institucionSeleccionada?.nombre}
                                        </div>
                                        <button onClick={() => setFiltroInstitucion('')}

                            </div>
                            <div>
                                <label className="block text-sm font-semibold text-gray-700 mb-2">Grado</label>
                                <select value={filtroGrado} onChange={e => setFiltroGrado(e.target.value)}
                                    className="w-full px-4 py-3 border-2 border-purple-200 rounded-xl outline-none">
                                    <option value="">Todos los grados</option>
                                    {GRADOS.map(g => <option key={g} value={g}>{g}</option>)}
                                </select>
                            </div>

                        {/* Selector prueba activa */}
                        <div className="mt-4">
                            <label className="block text-sm font-semibold text-gray-700 mb-2">üéØ Prueba que quieres ver</label>
                            <div className="flex flex-wrap gap-2">
                                {MOMENTOS.map(m => {
                                    const cfg = MOMENTO_CONFIG[m];
                                    const isActive = filtroMomento === m;
                                    return (
                                        <button key={m} onClick={() => setFiltroMomento(isActive ? '' : m)}
                                            className={`px-4 py-2 rounded-xl font-semibold text-sm border-2 transition ${isActive ? `${cfg.bg} ${cfg.text} ${cfg.border}` : 'bg-white text-gray-600 border-gray-300 hover:border-purple-300'}`}>
                                            {cfg.emoji} {m}
                                        </button>
                                    );

                                {filtroMomento && (
                                    <button onClick={() => setFiltroMomento('')}
                                        className="px-4 py-2 rounded-xl font-semibold text-sm border-2 bg-white text-gray-500 border-gray-300 hover:border-red-300">

                            </div>

                            <div className="flex flex-wrap gap-2">

                                </button>

                                </button>
                            </div>

                    {/* ‚îÄ‚îÄ Ranking Consultores con Podio ‚îÄ‚îÄ */}

                                <span className={`ml-2 text-sm px-2 py-1 rounded-full ${cfgActual.bg} ${cfgActual.text}`}>{cfgActual.emoji} {momentoActual}</span>
                            </h2>
                        </div>

                        {/* PODIO TOP 3 ‚Äî solo sin filtro de consultor, con puestos reales */}
                        {!filtroConsultor && rankingGlobal.length >= 3 && (() => {
                            // Tomar top3 del ranking GLOBAL
                            const top3Global = rankingGlobal.slice(0, 3);
                            // Buscar datos completos en metricasPorConsultor para cada uno
                            const allCons = (() => {
                                const map = new Map();
                                const baseAll = estudiantesEnriquecidos.filter(est => {
                                    if (filtroInstitucion && est.codigoInstitucion !== filtroInstitucion) return false;
                                    if (filtroGrado && est.grado !== filtroGrado) return false;
                                    return true;
                                });
                                const instAll = new Map();
                                baseAll.forEach(est => {
                                    if (!instAll.has(est.codigoInstitucion)) instAll.set(est.codigoInstitucion, { consultor: est.consultor, inscritos: 0, evaluados: 0 });
                                    const i = instAll.get(est.codigoInstitucion);
                                    i.inscritos++;
                                    if (presentoEn(est, filtroMomento)) i.evaluados++;
                                });
                                instAll.forEach(inst => {
                                    if (!map.has(inst.consultor)) map.set(inst.consultor, { inscritos: 0, evaluados: 0 });
                                    const c = map.get(inst.consultor);
                                    c.inscritos += inst.inscritos;
                                    c.evaluados += inst.evaluados;
                                });
                                return map;
                            })();
                            const makeData = (nombre) => {
                                const d = allCons.get(nombre) || { inscritos: 0, evaluados: 0 };
                                return { consultor: nombre, totalInscritos: d.inscritos, totalEvaluados: d.evaluados, porcentajePromedio: d.inscritos > 0 ? d.evaluados/d.inscritos*100 : 0 };
                            };
                            const top3 = top3Global.map(r => makeData(r.consultor));
                            const podioConfig = [
